/*Table of Contents

    fonts
    text elements
    nav
    lists
        -alignment and sizing
    animations
        -swup transitions
    sizing
    opacity
    ------------
    page specific
        --coming soon page
        --home
        --zentella project page
    screen configurations
*/

body, html {
    scroll-snap-type: y proximity;
    margin: 0.1%;
}

/*fonts*/

@import url("https://use.typekit.net/ghk0tik.css");

@counter-style en-dash {
    system: fixed;
    symbols: 'â€“';
    suffix: ' ';
}



/*text elements*/
html {
    hyphens: auto;
    -ms-hyphens: auto;
}

h1 {
    font-family: minion-pro, serif;
    font-weight: 400;
    font-style: normal;
    font-size: 34px;
}

h2 {
    font-family: meno-banner, serif;
    font-weight: 400;
    font-style: normal;
    font-size: 34px;
}

p {
    font-family: minion-pro, serif;
    font-weight: 400;
    font-style: normal;
    font-size: 26px;
}

.cap {
    font-family: minion-pro-caption, serif;
    font-weight: 400;
    font-style: normal;
    font-size: 34;
}

figcaption {
    font-family: minion-pro-caption, serif;
    font-weight: 400;
    font-style: normal;
    font-size: 16px;
    margin-top: 2em;
}

hr {
    color: #434343;
    width: 90%;
    margin: 15px;
    line-height: 0;
}

.small-caps {
    font-variant-caps: all-small-caps;
    -moz-font-feature-settings: "smcp";
    -webkit-font-feature-settings: "smcp";
    font-feature-settings: "smcp";
    letter-spacing: 4px;
}

a {
    text-decoration: underline;
    color: black;
}

.bold {
    font-family: minion-pro, serif;
    font-weight: 700;
    font-style: normal;
}

.light {
    font-weight: 300;
}
/*nav*/

nav {
    right: 0;
    position:fixed;
    z-index:99;
    top:0;
    height:calc(4vh + 36px);
}

nav img {
    transition:1s ease-in-out;
    position:absolute;
    height:14px;
    width:28px;
    right:4vw;
    top:4vh;
    z-index: 98;
}

nav img:hover {
    filter: brightness(4);
    cursor: pointer;
}

nav ul {
    position:relative;
    list-style:none;
    padding-right:calc(4vw + 1em);
    padding-top:3em;
    padding-left:0;
    text-align: right;
    z-index:97;
}

ul .closed {
    opacity: 0;
    transform: translateY(-3em);
    transition: 0.8s ease-in-out;
    visibility: hidden;
}

ul .open {
    opacity: 1;
    transform: translateY(0);
    transition: 1s ease-in-out;
    visibility: visible;
}

/*lists*/

/*-alignment and sizing*/
.center-items {
    display: flex;
    align-items: center;
    justify-content: center;
}

.center-row {
    display: flex;
    align-items: center;
    flex-direction: column;
}

.h-space {
    margin: 0 50px;
}

.v-space {
    margin-top: 10%;
}

.em-indent {
    margin-left: 1em;
}

.en-indent {
    text-indent: 0.5em;
}

section {
    padding: 5vh 15% 0;
    box-sizing: border-box;
    display: block;
    overflow: hidden;
}

.space-around {
    display: flex;
    justify-content: space-around;
    flex-wrap: wrap;
}

#index .single-column {
    min-width: 20em;
    max-width: 43%;
}

.single-column {
    max-width: 30em;
}

.double-column {
    column-count: 2;
    text-align: left;
}

/*animations*/

.fade-slide-right {
    animation: fade-in 1.5s forwards, slide-right 1.5s;
}

.fade-in {
    animation: fade-in 3s forwards;
}

@keyframes fade-in {
    from {opacity: 0;}
    to {opacity: 1;}
}

@keyframes lock {
    from {
        height: 100vh;
        overflow: hidden;
    }
    to {
        height: fit-content;
        overflow-y: scroll;
    }
}

@keyframes slide-right {
    from {transform: translateX(-5em);}
    to {transform: translateX(0);}
}

@keyframes bounce-down {
    from {transform: translateY(-120%);}  
    60% {transform: translateY(15%);}
    to {transform: translateY(0);}
}

@keyframes unveil-down {
    from {
        height: 100%;
    }
    to {
        height: 0;
        visibility: hidden;
    }
}

@keyframes bounce-up {
    from {transform: translateY(100vh);}
    60% {transform: translateY(-15%);}
    to {transform: translateY(0);}
}


@keyframes float1 {
    from {transform: translate(0, 0) rotate(0.12turn);}
    20% {transform: translate(-60px, -10px) rotate(-0.12turn);}
    40% {transform: translate(-110px, -30px) rotate(-0.32turn);}
    60% {transform: translate(-140px, -60px) rotate(-0.6turn);}
    80% {transform: translate(-150px, -90px) rotate(-0.8turn);}
    to {transform: translate(-190px, -140px) rotate(-1turn);}
}

@keyframes float2 {
    from {transform: translate(0, 0) rotate(0.52turn);}
    20% {transform: translate(20px, 40px) rotate(0.72turn);}
    40% {transform: translate(25px, 80px) rotate(0.92turn);}
    60% {transform: translate(20px, 120px) rotate(1.12turn);}
    80% {transform: translate(15px, 160px) rotate(1.32turn);}
    to {transform: translate(5px, 200px) rotate(1.52turn);}
}

@keyframes float3 {
    from {transform: translate(0, 0) rotate(0.43turn);}
    20% {transform: translate(40px, -30px) rotate(0.2turn);}
    40% {transform: translate(80px, 0px) rotate(0.4turn);}
    60% {transform: translate(120px, 20px) rotate(0.6turn);}
    80% {transform: translate(160px, 40px) rotate(0.8turn);}
    to {transform: translate(200px, 60px) rotate(1turn);}
}

@keyframes float4 {
    from {transform: translate(0, 0) rotate(0.78turn);}
    20% {transform: translate(40px, -40px) rotate(0.63turn);}
    40% {transform: translate(20px, -80px) rotate(0.48turn);}
    60% {transform: translate(-20px, -120px) rotate(0.33turn);}
    80% {transform: translate(-60px, -160px) rotate(0.18turn);}
    to {transform: translate(-40px, -200px) rotate(0.03turn);}
}

@keyframes float5 {
    from {transform: translate(0, 0) rotate(0.67turn);}
    20% {transform: translate(40px, 20px) rotate(0.87turn);}
    40% {transform: translate(60px, 50px) rotate(1.17turn);}
    60% {transform: translate(80px, 70px) rotate(1.37turn);}
    80% {transform: translate(100px, 110px) rotate(1.57turn);}
    to {transform: translate(120px, 150px) rotate(1.77turn);}
}
/*swup transitions*/
.transition-fade {
    opacity: 1;
    transition: 1s;
}

html.is-animating .transition-fade {
    opacity: 0;
}

/*sizing*/
.fullscreen {
    height: 100vh;
    width: 100vw;
    position: absolute;
}

.golden-ratio {
    padding-top: 61.8%;
}

/*opacity*/
.overflow-hidden {
    overflow: hidden;
}

.hidden {
    opacity: 0;
    transition: 0.5s ease-out opacity;
}

.visible {
    opacity: 1;
    transition: 2s ease-out opacity;
}

.blur {
    filter: blur(3px);
}

/*page specific*/

/*--coming-soon page*/
#coming-soon {
    height: 300px;
}

/*--home*/
#anim-1 {
    font-family: minion-pro, serif;
    font-weight: 400;
    font-style: normal;
    color: #F53B3B;
    font-size: 26px;
    line-height: 13px;
}

#anim-2 {
    font-family: minion-pro-subhead, serif;
    font-weight: 400;
    font-style: normal;
    font-size: 26px;
    color: #3A3A3A;
    line-height: 13px;
}

#anim-1, #anim-2, #anim-3, #anim-4, #anim-5 {
    opacity: 0;
}

#section-1 {
    background-color: hsl(45, 100%, 98%);
    min-height: 85vh;
}

#content-1 {
    padding: 0;
    margin: 15vh 0;
}

#b-sig {
    min-width: 30%;
}



#section-2 {
    background-color:  hsl(45, 100%, 99%);
    margin-bottom: 4em;
    padding-right: 17%;
    min-height: 27em;
    position: relative;
}

#content-2 {
    z-index: 5;
}

#contact-footer {
    text-align: center;
    padding-bottom: 50px;
    scroll-snap-align: end;
}

.floating {
    font-size: 89px;
    opacity: 10%;
    position: absolute;
    user-select: none;
    z-index: 0;
}

#l1 {
    bottom: -20%;
    left: 25%;
    transform: rotate(0.12turn);
    animation: float1 50s linear 1.5s both infinite alternate;
}

#l2 {
    bottom: 30%;
    left: 33%;
    transform: rotate(0.52turn);
    animation: float2 50s linear 1s both infinite alternate;
}

#l3 {
    bottom: 50%;
    right: 50%;
    transform: rotate(0.43turn);
    animation: float3 50s linear both infinite alternate;
}

#l4 {
    right: 40%;
    bottom: -10%;
    transform: rotate(0.78turn);
    animation: float4 40s linear both infinite alternate;
}

#l5 {
    bottom: 35%;
    right: 25%;
    transform: rotate(0.67turn);
    animation: float5 40s linear both infinite alternate;
}

#z-header {
    padding: 5vh 2vw 0;
    width: 100%;
    border: 1px solid #707070;
    box-shadow: 0px 0px 5px #707070;
    position: relative;
}

.z-box-bounce-up {
    animation: bounce-up 1.5s ease-out;
}

#projects-tag a {
    text-decoration: none;
}

#zentella-card {
    padding: 1vh 0 0;
    width: 100%;
    scroll-snap-align: start; 
}

#index #zentella-content {
    min-height: 600px; 
    max-height: 100vh;
    margin-bottom: 28vh;
    border: 1px solid #707070;
    box-shadow: 0px 0px 5px #707070;
    padding: 5vh 2vw 0;
    transition: opacity 2s;
    position: relative;
}

.ten-mincho {
    font-family: 'ten-mincho';
    font-weight: 400;
}

#zentella-header {
    font-size: 42px;
    width: fit-content;
    margin: 0 auto;
    background-color:hsla(0, 0%, 100%, 80%);
    border-radius: 10%;
}

#zentella-content img, #z-header img {
    width: 150px;
    z-index: -10;
}

#zentella-content img:nth-of-type(1), #z-header img:nth-of-type(1) {
    position: absolute;
    left: 20%;
    top: 35%;
    transform: rotate(-0.05turn);
}

#zentella-content img:nth-of-type(2), #z-header img:nth-of-type(2) {
    position: absolute;
    right: 20%;
    top: 30%;
    transform: rotate(0.05turn);
}

.chaparral {
    font-family: chaparral-pro;
}

.ten-mincho {
    font-family: ten-mincho;
}

#zentella-content p, #z-header p {
    width:fit-content;
    margin: 0 auto;
    text-align: center;
    margin-top: 40px;
    background-color:hsla(0, 0%, 100%, 80%);
    border-radius: 10%;
}

#zentella-content a {
    position: absolute;
    bottom: 15%;
    right: 33%;
}

/*--Zentella Project Page*/

#z-card-unveil {
    background-color: white;
    border: 1px solid #707070;
    box-shadow: 0px 0px 5px #707070;
    animation: unveil-down 1s forwards 1.7s;
    position: fixed;
    bottom:0;
    height: 100%;
    width: 100%;
    z-index:1;
}

#z-header {
    animation: bounce-down 1.7s ease-out;
    z-index:2;
    background-color: white;
}

#zentella-project h3 {
    font-family: ten-mincho;
    font-size: 42px;
    font-weight:400;
    margin-top: 0;
    margin-bottom: 0;
}

#zentella-project p {
    font-family: chaparral-pro;
}

#z-brief {
    display:flex;
    flex-wrap:wrap;
    justify-content: space-between;
    margin: 2em 0 10em;
}



#z-brief > p {
    max-width: 60%;
}

#zentella-project hr {
    width: 30%;
    margin: 0 auto;
    background-color: #707070;
    border:none;
    height: 1px;
}

#z-artwork {
    margin-top: 3em;
}

#z-home-page {
    width: 50vw;
    margin: 10em auto;
    display: block;
    border: 1px solid #707070;
}

#z-artwork figure:first-of-type {
    margin: 7em 0 7em 2em;
}

#z-artwork figure:last-of-type {
    margin-left: 3em;
    margin-top: 7em;
}

#zentella-project figcaption {
    max-width: 40em;
}

#zentella-project figure:nth-child(2n) {
    margin-top: 10em;
}

#gif-process div div {
    display: flex;
    flex-wrap: wrap;
}

#gif-process div div:nth-child(2n+1) {
    margin-bottom:2em;
}

#gif-process img {
    height: 120px;
    margin: 0 auto;
    display: block;
}

#z-typography {
    margin-bottom: 10em;
}

#z-typography figure {
    margin-top: 3em;
    margin-bottom: 5em;
}

#z-typography figure > div {
    display: flex;
    flex-wrap: wrap;
    justify-content: space-between;
    position: relative;
    width: 70vw;
}

#z-scale {
    margin-top: 2em;
}

#z-scale > p {
    margin-bottom: 0;
}

#z-scale-a {
    display: flex;
    flex-direction: row;
    justify-content: space-between;
    width: 200px;
}

#z-scale div div {
    display: inline-flex;
    flex-direction: column;
    justify-content: flex-end;
}

#z-scale div span {
    text-align: center;
}

#z-typography .sample-text {
    font-size: 42px;
}

#z-screenshots {
    margin-top: 3em;}

#z-screenshots i {
    display: block;
    margin-left: 70%;
    margin-bottom: 1em;
    font-size: 21px;
}

#z-screenshots div:first-of-type {
    width: 50vw;
    margin: 0 auto 8em;
    display:block;
    overflow-y: scroll;
    height: 28vw;
    border: 1px solid #707070;
}

#z-screenshots #img-1 {
    width: 100%;
}

#z-screenshots div:last-of-type {
    display: flex;
    justify-content: space-evenly;
    margin-bottom: 10em;
    flex-wrap: wrap;
}

#z-screenshots div:last-child img {
    width: 33vw;
    border: 1px solid #707070;
}

#z-summary {
    font-family: minion-pro;
    text-align: center;
    margin: 3em auto 6em;
}

#z-summary p {
    margin: 1em auto;
}

#zentella-project #contact-footer {
    border-top: 1px solid gray;
}

/*screen configurations*/

@media screen and (max-width: 480px) {
    .floating {
        color: #f2f2f2;
    }
}

@media screen and (max-width: 550px) {
    #v-inline {
        display: none;
    }
    #z-brief > p {
        max-width: 30em;
    }
    #z-brief div {
        margin: 2em auto 0;
        text-align: center;
    }
    #zentella-content img:nth-of-type(1), #z-header img:nth-of-type(1) {
        left: 0%;
        top: 50%;
    }
    #zentella-content img:nth-of-type(2), #z-header img:nth-of-type(2) {
        right: 5%;
        top: 40%;
    }
    #zentella-project video, #z-screenshots div:last-child img {
        width: 100%;
    }
    #z-screenshots div:last-child img:first-child {
        margin-bottom: 5em;
    }
    #z-screenshots div:first-of-type {
        width: 100%;
        height: 56vw;
    }
    #zentella-project section {
        padding: 5vh 1em 0;
    }
}

@media screen and (max-width: 790px) {
    #b-sig {
        margin-bottom: 4em;
    }
    .double-column {
        column-count: 1;
    }
    #anim-2 {
        line-height: normal;
    }
    li[class='nav-item open'] {
        right: 0;
    }
}

@media screen and (max-width: 1050px) {
    #b-sig {
        margin: 0 10% 10%;
    }
    #index .single-column {
        max-width: 80%;
    }
    nav ul {
        width: 100vw;
        padding-bottom: 0.5em;
        padding-right: 0;
        text-align: center;
        transition: 1.5s ease-out;
    }
    nav[class~="open"] {
        background-color: white;
        transition: 0.5s ease-out;
    }
    nav ul[class~="open"] {
        background-color: white;
        transition: 0.5s ease-out;
    }
}
